import { Component } from '@angular/core';

@Component({
  selector: 'app-root',
  template: '<app-dashboard></app-dashboard>',
  styleUrls: ['./app.component.css']
})
export class AppComponent {
  title = 'SkySense IoT Dashboard';
}
